# https://stackoverflow.com/questions/3838329/how-can-i-check-if-two-segments-intersect
def line_intersect(x1, y1, x2, y2):
    ia = [max(min(x1[0], y1[0]), min(x2[0], y2[0])),
          min(max(x1[0], y1[0]), max(x2[0], y2[0]))]

    # No interval exists
    if max(x1[0], y1[0]) < min(x2[0], y2[0]):
        return False

    if x1[0] == y1[0] or x1[1] == y1[1]:
        A1 = 0
    else:
        A1 = (x1[1] - y1[1]) / (x1[0] - y1[0])
    if x2[0] == y2[0] or x2[1] == y2[1]:
        A2 = 0
    else:
        A2 = (x2[1] - y2[1]) / (x2[0] - y2[0])

    # Parralel segments
    if A1 == A2:
        return False

    b1 = x1[1] - A1 * x1[0]
    b2 = x2[1] - A2 * x2[0]

    if A1-A2 == 0:
        xa = 0
    else:
        xa = (b2 - b1) / (A1 - A2)

    if xa < ia[0] or xa > ia[1]:
        # Intersection out of range of segments
        return False
    else:
        return True


def similarity(p1, p2):
    d = gpxpy.geo.distance(p1[0], p1[1], 0,
                           p2[0], p2[1], 0)
    return d


def line_distance(x, y, p):
    a = abs(similarity(x, y))
    b = abs(similarity(x, p))
    c = abs(similarity(y, p))

    if int(a) is 0:
        return b

    s = (a+b+c) / 2
    return 2. * math.sqrt(abs(s*(s-a) * (s-b) * (s-c))) / a


def line_similarity(p1, p2, p3, p4):
    if p1 == p3 or p2 == p4 or p1 == p4 or p2 == p3 or line_intersect(p1, p2, p3, p4) is True:
        return 0.0
    else:
        a = line_distance(p1, p2, p3)
        b = line_distance(p1, p2, p4)
        c = line_distance(p3, p4, p1)
        d = line_distance(p3, p4, p2)
        return - min(a, b, c, d)

