def align_tracks(track1, track2, gap_penalty):

    if line_similarity(track1[0], track1[1], track2[0], track2[1]) < gap_penalty*30:
        return 0

    # construct f-matrix
    f = numpy.zeros((len(track1)-1, len(track2)-1))
    for i in range(0, len(track1)-1):
        f[i][0] = gap_penalty * i
    for j in range(0, len(track2)-1):
        f[0][j] = gap_penalty * j
    for i in range(1, len(track1)-1):
        t1 = track1[i-1]
        t2 = track1[i]
        for j in range(1, len(track2)-1):
            t3 = track2[j-1]
            t4 = track2[j]
            match = f[i-1][j-1] + line_similarity(t1, t2, t3, t4)
            delete = f[i-1][j] + gap_penalty
            insert = f[i][j-1] + gap_penalty
            f[i, j] = max(match, max(delete, insert))
    # backtrack to create alignment
    i = len(track1) - 2
    j = len(track2) - 2
    c_match = 0
    c_num = 0
    while i > 0 or j > 0:
        if i > 0 and j > 0 and f[i, j] == f[i-1][j-1] + line_similarity(track1[i-1], track1[i], track2[j-1], track2[j]):
            c_match += 1
            c_num += 1
            i -= 1
            j -= 1
        elif i > 0 and f[i][j] == f[i-1][j] + gap_penalty:
            c_num += 1
            i -= 1
        elif j > 0 and f[i][j] == f[i][j-1] + gap_penalty:
            c_num += 1
            j -= 1
    return (c_match*100)/c_num





